// HasControlWith applies the HasEdge predicate on the "control" edge with a given conditions (other predicates).
func HasControlWith(preds ...predicate.Control) predicate.ControlScheduledJob {
	return predicate.ControlScheduledJob(func(s *sql.Selector) {
		step := newControlStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.Control
		step.Edge.Schema = schemaConfig.ControlScheduledJob
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

